export const deleteSlot = (slot, babysitter) => {
    timeId = slot.time_of_day.map(t => t.id)
    for (slotId of timeId) {
        return dispatch => {
            return fetch(`http://localhost:3000/api/v1/babysitters/${babysitter.id}/slots/${slotId}`, {
                method: 'DELETE'
            })
                .then(response => response.json())
                .then(babysitter => dispatch({ type: 'DELETE_SLOT', payload: babysitter }))
        }
    }


}
